import React from 'react';

const HelloSt = {
    backgroundColor : 'black'
    , color : 'aqua'
    , fontSize : 24
    , padding : '1rem'
    , textAlign : 'center'
}

function Hello({color, name}){
    return(
        <>
            <div style={HelloSt}>안녕하세요!</div>
            <div style={HelloSt}>이 프로젝트의 이름은 {name}  입니다.</div>
            <div style={{color:color}}>이 div의 color 는 {color} 입니다.</div>
        </>

    );
}

Hello.defaultProps = {
    name : '이름없음'
    , color : '색깔없음'
}

export default Hello;
